INSERT INTO `blogs` (`id`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(1, '**Giáo sư, Tiến sĩ, Bác sĩ Phạm Thị Hoa**\n\n- Giáo sư, Tiến sĩ, Bác sĩ chuyên ngành Tiêu hóa - Gan mật\n- Nguyên Giám đốc bệnh viện Đại Học Y Hà Nội\n- Nguyên Tổng thư ký hội khoa học tiêu hóa Việt Nam\n- Nguyên Trưởng khoa tiêu hóa Bệnh viện Bạch Mai\n- Nguyên Giám đốc Trung tâm Nội soi Bệnh viện Đại học Y Hà Nội\n- Tốt nghiệp Đại học Y Hà Nội (1983)\n- Tốt nghiệp Bác sĩ Nội trú trường Đại học Y Hà Nội (1986)\n- Tốt nghiệp tiến sĩ Y khoa (1993)\n\n- Bác sĩ không thăm khám ban đầu, chỉ đọc kết quả\n\n**Lưu ý**: Quy trình sau đây áp dụng khi đi khám chữa bệnh với Giáo sư, Tiến sĩ Đào Văn Long', 'Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP.HCM\nNguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TPHCM\nBác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu\nBác sĩ nhận khám mọi độ tuổi', 6, NULL, NULL, '2022-04-15 20:32:48', '2022-04-16 16:19:16'),
(2, '**Phó Giáo sư, Tiến sĩ, Bác sĩ Cao cấp Nguyễn Duy Hưng**\n\n- Phó giáo sư, Tiến sĩ, Bác sĩ cao cấp chuyên khoa Da liễu\n- Tốt nghiệp Đại học Y Hà Nội (1977)\n- Bác sĩ từng công tác tại Bệnh viện Da liễu Trung ương\n- Giảng viên bộ môn Da liễu tại Đại Học Y Hà Nội\n- Nguyên Trưởng phòng chỉ đạo tuyến tại Bệnh viện Da liễu Trung ương\n- Đạt chứng chỉ Diploma về Da liễu tại Viện da liễu Băng Cốc - Thái Lan\n- Bác sĩ thường xuyên tham gia các Hội thảo, Hội nghị Quốc tế về Da liễu\n- Tổng thư ký hội Da liễu Việt Nam\n- Hội viên của Hội Da liễu Đông Nam Á, Châu Á và Thế giới', 'hghgh', 2, NULL, NULL, '2022-04-16 10:05:05', '2022-04-16 10:05:05'),
(3, '**Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Ngọc Duy**\n\n- Giáo sư, Tiến sĩ, Bác sĩ chuyên ngành Tiêu hóa - Gan mật\n- Nguyên Giám đốc bệnh viện Đại Học Y Hà Nội\n- Nguyên Tổng thư ký hội khoa học tiêu hóa Việt Nam\n- Nguyên Trưởng khoa tiêu hóa Bệnh viện Bạch Mai\n- Nguyên Giám đốc Trung tâm Nội soi Bệnh viện Đại học Y Hà Nội\n- Tốt nghiệp Đại học Y Hà Nội (1983)\n- Tốt nghiệp Bác sĩ Nội trú trường Đại học Y Hà Nội (1986)\n- Tốt nghiệp tiến sĩ Y khoa (1993)\n- Bác sĩ không thăm khám ban đầu, chỉ đọc kết quả\n\n**Lưu ý**: Quy trình sau đây áp dụng khi đi khám chữa bệnh với Giáo sư, Tiến sĩ Đào Văn Long', 'hhga', 8, NULL, NULL, '2022-04-16 10:15:59', '2022-04-16 10:15:59'),
(4, '**saa**', 'aasa', 5, NULL, NULL, '2022-04-21 16:55:56', '2022-04-21 16:55:56'),
(5, 'sasa', 'ok', 7, NULL, NULL, '2022-04-24 20:33:21', '2022-04-24 20:33:21'),
(6, '- Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP. HCM\n- Bác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu\n- Bác sĩ nhận khám mọi độ tuổi\n\n**Quá trình công tác**\n\n- Trưởng khoa Dinh Dưỡng, Bệnh viện Da Liễu TP.HCM\n- Nguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TP.HCM\n- Hiện là Bác sĩ Da liễu, Phòng khám Da liễu Táo Đỏ\n- Bác sĩ chuyên khoa da liễu, thẩm mỹ da Bệnh Viện Da Liễu TP.HCM\n\n**Quá trình đào tạo**\n\n- Tốt nghiệp Bác sĩ Chuyên khoa II, chuyên ngành Da liễu, Đại học Y dược TP.HCM\n- Tốt nghiệp Bác sĩ Chuyên khoa I, chuyên ngành Da liễu, Đại học Y dược TP.HCM\n- Tốt nghiệp Bác sĩ Đa khoa, Đại học Y dược TP.HCM\n- Tham gia lớp Sơ bộ DInh dưỡng, Đại học Y khoa Phạm Ngọc Thạch\n- Thành viên các Hội khoa học, tổ chức chuyên môn\n- Hội viên chi hội Da Liễu Hồ Chí Minh\n- Hội viên Hội Da Liễu Việt Nam', 'Trưởng Khoa Dinh Dưỡng bệnh viện Da Liễu TP.HCM\nNguyên Phó trưởng khoa Lâm sàng 1, Bệnh viện Da Liễu TPHCM\nBác sĩ Hương có hơn 20 năm kinh nghiệm trong khám và điều trị bệnh lý da liễu\nBác sĩ nhận khám mọi độ tuổi', 22, NULL, NULL, '2022-05-02 15:18:32', '2022-05-02 15:18:32'),
(8, '**Quá trình đào tạo**\n\n- Tốt nghiệp Bác sĩ Đa khoa, Trường Đại học y dược thành phố Hồ Chí Minh\n- Học chuyên khoa cấp I và chuyên khoa cấp II Chuyên ngành Tâm thần, Đại học Y khoa Huế\n- Tốt nghiệp Tâm lý trị liệu, trường Tâm lý thực Hành Paris (Psychology practique de Paris)\n\n**Quá trình công tác**\n\n- Nguyên Trưởng phòng Kế hoạch Nghiệp vụ, Trưởng phòng khám Tâm thần Quận 3, thành phố Hồ Chí Minh\n- Nguyên Trưởng khoa lâm sàng Bệnh tâm thần thành phố Hồ Chí Minh\n- Giám định viên tư pháp chuyên ngành Tâm thần giám định các trường hợp trọng án, các trường hợp có liên quan pháp lý do cảnh sát điều tra, tòa án các cấp trưng cầu.', 'Nguyên Trưởng khoa lâm sàng, Bệnh tâm thần Thành phố Hồ Chí Minh\nTốt nghiệp Tâm lý trị liệu, trường Tâm lý Thực hành Paris (Psychology practique de Paris)\nBác sĩ nhận khám từ 16 tuổi trở lên', 25, NULL, NULL, '2022-05-04 13:48:31', '2022-05-04 13:48:31');

